　お子様の安全を第一に考えた機能性の充実、使いやすさを考慮した工夫が盛り込まれたアイデス社ならではの経験が
活かされたヘルメットの登場です！<br>
さらにお子様が楽しくかぶれるデザイン面も充実していますよ！<br>
<br>
【特徴】<br>
■ダイヤルアジャスター
ダイヤルアジャスターでお子様の頭囲に合わせたサイズ調節が可能です。<br>
■360度！リフレクター<br>
暗い道でも車のライトなどに対して全方向への反射に対応しているため、安全です。<br>
■バックルあご紐<br>
あごひもにバックルを採用しているので、ワンタッチでの着脱が可能です。<br>
<br>
【メーカー】<br>
アイデス(ides)<br>
【カラー】<br>
ピンク<br>
【JAN/品番】<br>
4523256019825/01982<br>
【サイズ】<br>
約W215×L275×H180mm<br>
【重量】<br>
約260g<br>
【適正頭囲】<br>
53～57cm<br>
【対象年齢】<br>
4～8歳(目安)<br>
<br>
SG基準に合格した、自転車・幼児座席用ヘルメットです。<br><br>
